function preview(n,t){if(t.width&&t.height){var u=$("#photo").width,f=$("#photo").height,i=160/t.width,r=160/t.height;$("#preview img").css({width:Math.round(i*360)+"px",height:Math.round(r*360)+"px",marginLeft:"-"+Math.round(i*t.x1)+"px",marginTop:"-"+Math.round(r*t.y1)+"px"}),$("#x1").val(t.x1),$("#y1").val(t.y1),$("#x2").val(t.x2),$("#y2").val(t.y2),$("#w").val(t.width),$("#h").val(t.height)}}